import React from "react";
import styled from 'styled-components'

function Home() {
  return (
    <Container>
      <p>
        Take a look at my CV in <a href="/cv/lq_fr.pdf">French</a> and <a href="/cv/lq_en.pdf">English</a>.
      </p>
    </Container>
  );
}

export default Home;

const Container = styled.div`
  text-align: center;
`
